description:
It's NOT me, it's YOU... design and make beautiful "leather stuff to carry other stuff" from their studio in the heart of East London. 

Each leather purse available from Totes Amazed is part of a limited run which means that the leather colour and foil embossed slogan combinations are pretty hard to come by. 

We only have one of each leather colour/foil embossed slogan combination, so if you see a purse you love – grab it quick!

Made from Italian leather, fine zip, foil-embossed slogan. Measures 120 x 180mm approx.

