Screenprinted on hard wearing 230gsm natural canvas (100% cotton) this tote measures a HUGE 520 x 400mm when flat, with a 130mm block bottom gusset (oo-er). 

Double stitched for extra strength, with long handles to carry all that weight. This tote is large enough to carry away the whole supermarket with its massive 20 litre capacity.

